import { createNativeStackNavigator } from "@react-navigation/native-stack";
import AppRoutes from "../../../utils/app-routes";
import Filter from "../../pages/shared/filter";
import PetDetail from "../../pages/shared/pet-detail";
import PetForm from "../../pages/shared/pet-form";
import MyAdoptedPets from "../../pages/my-adopted-pets";

const Stack = createNativeStackNavigator();

const SharedScreens = [
    <Stack.Screen key={'s1'} name={AppRoutes.SharedScreens.Filter.name} component={Filter} options={{ headerShown: false }} />,
    <Stack.Screen key={'s2'} name={AppRoutes.SharedScreens.PetDetail.name} component={PetDetail} options={{ headerShown: false }} />,
    <Stack.Screen key={'s3'} name={AppRoutes.SharedScreens.PetForm.name} component={PetForm} options={{ headerShown: false }} />,
    <Stack.Screen key={'s4'} name={AppRoutes.SharedScreens.MyAdoptedPets.name} component={MyAdoptedPets} options={{ headerShown: false }} />,
]

export default SharedScreens;
